// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;
//  Solidity Voting
contract Voting {
    // 

    //    votesReceived  KEY VALUE   KEYbytes32  uint256()
    // 
    mapping(bytes32 => uint256) public votesReceived;
    //       bytes32
    // 
    bytes32[] public candidateList;
    //  key value  key address  KEY VALUE  key  bytes32  bool
    // address     
    // bool  boolean
    // hasVoted 
    // contract  
    mapping(address => mapping(bytes32 => bool)) public hasVoted; // 

    //           bytes32     _candidateNames
    // memory
    // 
    constructor(bytes32[] memory _candidateNames) {
        candidateList = _candidateNames;
    }

    // 
    //     voteForCandidate   bytes32   candidate
    function voteForCandidate(bytes32 candidate) public {
        // require  require 
        // require  
        require(validCandidate(candidate), "Invalid candidate");
        require(
            //msg.sendercandidate
            !hasVoted[msg.sender][candidate],
            "Already voted for this candidate"
        ); // 

        votesReceived[candidate] += 1;
        hasVoted[msg.sender][candidate] = true; // 
    }

    //     totalVotesFor   bytes32   candidate uint256
    //  view gas
    // view 
    // 
    function totalVotesFor(bytes32 candidate) public view returns (uint256) {
        require(validCandidate(candidate), "Invalid candidate");
        return votesReceived[candidate];
    }

    // 
    function validCandidate(bytes32 candidate) public view returns (bool) {
        for (uint i = 0; i < candidateList.length; i++) {
            if (candidateList[i] == candidate) {
                return true;
            }
        }
        return false;
    }
}
